import React from "react";
import IntroductionStyled from "./introduction.styled";

const Introduction = () =>{
    return <IntroductionStyled>
        <h1>Oi. Eu sou David. Prazer em te conhecer.</h1>
        <p>Comecei a programar aos 15 anos e desenvolvi grande paixão pela àrea. Aos 16 percebi que não me adequava ao metodo
        de ensino da Escola tradicional Brasileira, e que na verdade ela estava em certa forma me atrazando em relação aos meus estudos
            no ramo da tecnologia. Sendo assim decidi deixar de frequentar a escola tradicional para dedicar 100% de meus esforços em
            expandir meu conhecimento como desenvolvedor. Desde então tem sido uma jornada de muito trabalho e aprendizado.
        </p>
    </IntroductionStyled>
}

export default Introduction
